import React, { useEffect, useState } from 'react';

export default function AchievementsContent() {

    const [achievements, setAchievements] = useState([]);
    const [loading, setLoading] = useState(false);

    // Fetch data la montare
    useEffect(() => {
        const fetch_achievements = async () => {
            setLoading(true);
            try {
                // AICI VEI PUNE FETCH-UL REAL CATRE BACKEND CAND E GATA:
                // const resp = await fetch('http://localhost:5019/achievements', { credentials: "include" });
                // const data = await resp.json();

                // --- DATE DUMMY PENTRU TEST ---
                const dummyData = [
                    { id: 1, title: 'First Steps', description: 'Created your first note', unlocked: true, date: '2023-12-01' },
                    { id: 2, title: 'Study Buddy', description: 'Joined a study group', unlocked: true, date: '2023-12-05' },
                    { id: 3, title: 'Note Master', description: 'Create 50 notes', unlocked: false, date: null },
                    { id: 4, title: 'Night Owl', description: 'Edit a note after midnight', unlocked: false, date: null },
                ];

                // Simulam delay de retea
                setTimeout(() => {
                    setAchievements(dummyData);
                    setLoading(false);
                }, 300);

            } catch (err) {
                console.error("Eroare incarcare achievements:", err);
                setLoading(false);
            }
        };

        fetch_achievements();
    }, []);

    // Layout principal
    return (
        <div className="flex-1 p-6 overflow-auto h-full bg-gray-50">

            {/* Header */}
            <div className="mb-6 border-b pb-4">
                <div className="flex items-center justify-between">
                    <div className="flex items-center gap-3">
                        <div className="bg-yellow-100 p-2 rounded-lg text-yellow-600">
                            <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z" />
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 3v4M3 5h4M6 17v4m-2-2h4m5-16l2.286 6.857L21 12l-5.714 2.143L13 21l-2.286-6.857L5 12l5.714-2.143L13 3z" />
                            </svg>
                        </div>
                        <div>
                            <h2 className="text-2xl font-bold text-gray-800">Achievements</h2>
                            <p className="text-sm text-gray-500">Track your milestones and progress</p>
                        </div>
                    </div>

                    {/* Statistica dreapta sus */}
                    <div className="flex gap-3">
                         <div className="px-4 py-2 rounded-lg bg-white border text-sm text-gray-600 font-medium shadow-sm">
                            {achievements.filter(a => a.unlocked).length} / {achievements.length} Unlocked
                        </div>
                    </div>
                </div>
            </div>

            {/* Content List */}
            <h3 className="text-sm font-bold text-gray-500 uppercase tracking-wide mb-3">Trophies List</h3>

            {loading ? <p className="text-center text-gray-400 mt-10">Loading achievements...</p> : (
                achievements.length === 0 ? (
                    <div className="text-center p-10 bg-white rounded-lg border border-dashed text-gray-400">
                        No achievements found.
                    </div>
                ) : (
                    <div className="grid grid-cols-1 gap-3">
                        {achievements.map(ach => (
                            <div 
                                key={ach.id} 
                                className={`bg-white p-4 rounded-lg shadow-sm border flex justify-between items-center transition-all ${
                                    !ach.unlocked ? 'opacity-60 bg-gray-50' : 'hover:border-yellow-400'
                                }`}
                            >
                                <div className="flex items-center gap-4">
                                    <div className={`p-3 rounded-full ${ach.unlocked ? 'bg-yellow-50 text-yellow-500' : 'bg-gray-200 text-gray-400'}`}>
                                        <svg className="w-6 h-6" fill={ach.unlocked ? "currentColor" : "none"} stroke="currentColor" viewBox="0 0 24 24">
                                            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M11.049 2.927c.3-.921 1.603-.921 1.902 0l1.519 4.674a1 1 0 00.95.69h4.915c.969 0 1.371 1.24.588 1.81l-3.976 2.888a1 1 0 00-.363 1.118l1.518 4.674c.3.922-.755 1.688-1.538 1.118l-3.976-2.888a1 1 0 00-1.176 0l-3.976 2.888c-.783.57-1.838-.197-1.538-1.118l1.518-4.674a1 1 0 00-.363-1.118l-3.976-2.888c-.784-.57-.38-1.81.588-1.81h4.914a1 1 0 00.951-.69l1.519-4.674z" />
                                        </svg>
                                    </div>
                                    <div>
                                        <h4 className={`font-bold ${ach.unlocked ? 'text-gray-800' : 'text-gray-500'}`}>{ach.title}</h4>
                                        <p className="text-sm text-gray-600 mt-1">{ach.description}</p>
                                    </div>
                                </div>

                                <div className="text-xs">
                                    {ach.unlocked ? (
                                        <span className="text-green-600 bg-green-50 px-3 py-1 rounded-full font-medium border border-green-100">
                                            Unlocked: {ach.date}
                                        </span>
                                    ) : (
                                        <span className="text-gray-400 bg-gray-100 px-3 py-1 rounded-full font-medium border border-gray-200">
                                            Locked
                                        </span>
                                    )}
                                </div>
                            </div>
                        ))}
                    </div>
                )
            )}
        </div>
    );
}
